import React from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';
import useStyles from './styles';
import appBarImg from '../../images/appbarlogo.jpg';
import { Link } from 'react-router-dom';


const Navbar = () => {
    const classes = useStyles();
    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to="/" className={classes.heading} variant="h2" align="center">Social Media App</Typography>
                <img src={appBarImg} className={classes.image} alt="appBarImg" height="60" />
            </div>
            <Toolbar className={classes.toolbar}>
                {}
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
